DROP TABLE IF EXISTS houses;

create table houses (
    id SERIAL PRIMARY KEY,
    img TEXT,
    name VARCHAR(200),
    address VARCHAR(200),
    city VARCHAR(200),
    state VARCHAR(200),
    zipcode INTEGER,
    monthly_mortgage INTEGER,
    desired_rent INTEGER
);

